import React,{ Component} from 'react';
import RangeBarChart from "./views/column charts/Range Bar Chart";
import { BrowserRouter as Router, Switch, Route, Link } from 'react-router-dom';

class App extends Component {
  render() {    
    // return (
    //   <div>
    //       <Navigation/>
    //       {/* <RangeBarChart/> */}
    //   </div>   
    // );

    return (
      <Router>
          <div>
            <h2>  Transformer</h2>
            <nav className="navbar navbar-expand-lg navbar-light bg-light">
            <ul className="navbar-nav mr-auto">
              <li><Link to={'/topology'} className="nav-link"> Topology </Link></li>
              <li><Link to={'/energybalance'} className="nav-link">Energy balance </Link></li>
              <li><Link to={'/voltage'} className="nav-link">Voltage </Link></li>
            </ul>
            </nav>
            <hr />
            <Switch>
                <Route exact path='/topology' component={RangeBarChart} />
                {/* <Route path='/' component={Contact} />
                <Route path='/' component={About} /> */}
            </Switch>
          </div>
        </Router>
      );
  }
}

export default App;
